import React, { useState, useEffect } from "react";
import axios from 'axios';
import { 
    TextField, Button, Select, MenuItem, FormControl, InputLabel, 
    Dialog, DialogActions, DialogContent, DialogTitle, Box 
} from '@mui/material';

export default function TransacaoForm({ open, onSave, onCancel, initialData }) {
    const [tipo, setTipo] = useState("gasto");
    const [valor, setValor] = useState("");
    const [categoria, setCategoria] = useState("");
    const [descricao, setDescricao] = useState("");
    const [data, setData] = useState(new Date().toISOString().slice(0, 10));
    const [error, setError] = useState("");

    const isEditMode = initialData && initialData.id;

    useEffect(() => {
        if (isEditMode) {
            setTipo(initialData.tipo);
            setValor(initialData.valor);
            setCategoria(initialData.categoria || "");
            setDescricao(initialData.descricao || "");
            setData(new Date(initialData.data).toISOString().slice(0, 10));
        } else {
            // Reset form for creation
            setTipo("gasto");
            setValor("");
            setCategoria("");
            setDescricao("");
            setData(new Date().toISOString().slice(0, 10));
        }
    }, [initialData, isEditMode, open]);


    async function handleSubmit(e) {
        e.preventDefault();
        setError("");
        const token = localStorage.getItem("token");
        const transactionData = { tipo, valor: parseFloat(valor), categoria, descricao, data };

        try {
            if (isEditMode) {
                await axios.put(`http://127.0.0.1:8000/transacoes/${initialData.id}`, transactionData, { headers: { Authorization: `Bearer ${token}` } });
            } else {
                await axios.post("http://127.0.0.1:8000/transacoes/", transactionData, { headers: { Authorization: `Bearer ${token}` } });
            }
            onSave();
        } catch (err) {
            setError("Erro ao salvar transação. Verifique os dados.");
        }
    }

    return (
        <Dialog open={open} onClose={onCancel}>
            <DialogTitle>{isEditMode ? 'Editar Transação' : 'Adicionar Transação'}</DialogTitle>
            <DialogContent>
                <Box component="form" onSubmit={handleSubmit} sx={{ mt: 1 }}>
                    <FormControl fullWidth margin="normal">
                        <InputLabel id="tipo-label">Tipo</InputLabel>
                        <Select
                            labelId="tipo-label"
                            value={tipo}
                            label="Tipo"
                            onChange={e => setTipo(e.target.value)}
                        >
                            <MenuItem value="receita">Receita</MenuItem>
                            <MenuItem value="gasto">Gasto</MenuItem>
                        </Select>
                    </FormControl>
                    <TextField
                        margin="normal"
                        required
                        fullWidth
                        label="Valor"
                        type="number"
                        value={valor}
                        onChange={e => setValor(e.target.value)}
                    />
                    <TextField
                        margin="normal"
                        fullWidth
                        label="Categoria"
                        value={categoria}
                        onChange={e => setCategoria(e.target.value)}
                    />
                    <TextField
                        margin="normal"
                        fullWidth
                        label="Descrição"
                        value={descricao}
                        onChange={e => setDescricao(e.target.value)}
                    />
                    <TextField
                        margin="normal"
                        required
                        fullWidth
                        type="date"
                        label="Data"
                        value={data}
                        onChange={e => setData(e.target.value)}
                        InputLabelProps={{ shrink: true }}
                    />
                    {error && <Typography color="error">{error}</Typography>}
                </Box>
            </DialogContent>
            <DialogActions>
                <Button onClick={onCancel}>Cancelar</Button>
                <Button onClick={handleSubmit} variant="contained">Salvar</Button>
            </DialogActions>
        </Dialog>
    );
}
